// set a bar chart according to data passed
function setBar(data, mode) {
    // remove current bar chart first
    d3.select(".bar").selectAll("div").remove();
    var sum = 0;
    for (var i=0; i<data.length; i++) {
        sum += data[i];
    }
    var x = d3.scaleLinear()
        .domain([0, d3.max(data)])
        .range([0, 400]);

    if (mode == "historic") {
        var severity = ["O","A","B","C","D","E","N.A"];
        d3.select(".bar")
            .selectAll("div")
            .data(data)
            .enter().append("div")
            .style("width", function (d) {
                return x(d) + "px";
            })
            .style("background-color", function(d,i){
                return colors[i];
            })
            .text(function (d,i) {
                return "Severity "+ "["+severity[i]+"] "+(d*100/sum).toFixed(1)+"%";
            });
    }
    var labelWidth = 0;

    if (mode == "explore") {
        var list = ["current: ", "updated: "];
        d3.select(".bar")
            .selectAll("div")
            .data(data)
            .enter().append("div")
            .style("width", function (d) {
                return x(d)+ "px";
            })
            .style("height", "60px")
            .style("background-color", function(d,i){
                return colors[i];
            })
            .text(function (d,i) {
                return "Response time "+list[i]+Math.round(d/60)+" min, "+Math.round(d%60)+ "sec";
            })
            .style("font-size", "16px")
            .attr("dy", ".95em");
    }
    
    console.log("-->Bar chart success");
    document.getElementsByClassName("loading")[1].style.display= "none";
}

